"use strict";(globalThis.webpackChunkfirst_trial=globalThis.webpackChunkfirst_trial||[]).push([[2242],{1654(n){n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"React","metadata":{"permalink":"/usecase/React","source":"@site/usecase/2026-01-19-React.mdx","title":"Node.js \uc124\uce58\ubd80\ud130 React \ud504\ub85c\uc81d\ud2b8 \uc2dc\uc791\uae4c\uc9c0","description":"Node.js \uc124\uce58\ubd80\ud130 React \ud504\ub85c\uc81d\ud2b8 \uc2dc\uc791\uae4c\uc9c0","date":"2026-01-20T00:00:00.000Z","tags":[],"readingTime":2.95,"hasTruncateMarker":false,"authors":[{"name":"\ubc29\ubbfc\uc8fc","title":"\ub370\uc774\ud130\ud50c\ub7ab\ud3fc\uc5f0\uad6c\uc13c\ud130 \uc5f0\uad6c\uc6d0","url":"https://github.com/bigdata-car","imageURL":"https://avatars.githubusercontent.com/u/153149491?s=400&u=ea254e4f1d3adf57eaaab5bba70f2caed1142d30&v=4","key":"mjbang"}],"frontMatter":{"slug":"React","title":"Node.js \uc124\uce58\ubd80\ud130 React \ud504\ub85c\uc81d\ud2b8 \uc2dc\uc791\uae4c\uc9c0","authors":["mjbang"],"date":"2026-01-20T00:00:00.000Z","tag":["Front-End"],"image":"/img/usecase/minju/02_react/react.jpg","description":"Node.js \uc124\uce58\ubd80\ud130 React \ud504\ub85c\uc81d\ud2b8 \uc2dc\uc791\uae4c\uc9c0"},"unlisted":false,"nextItem":{"title":"Customizing-Chatbot","permalink":"/usecase/Customizing-Chatbot"}},"content":"\ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc744 \uc2dc\uc791\ud560 \ub54c \uac00\uc7a5 \uba3c\uc800 \uc9c4\ud589\ud558\ub294 \uac83\uc740 \uac1c\ubc1c \ud658\uacbd \uc14b\ud305\uc785\ub2c8\ub2e4.\\r\\n\\r\\nReact \ud504\ub85c\uc81d\ud2b8\ub97c \uc2dc\uc791\ud558\uae30 \uc704\ud574\uc11c \ubc18\ub4dc\uc2dc Node.js\uac00 \ud544\uc694\ud569\ub2c8\ub2e4. \\r\\n\\r\\n\uc65c\ub0d0\ud558\uba74, Node.js \uc704\uc5d0\uc11c \ubaa8\ub4e0 \ube4c\ub4dc \ub3c4\uad6c\uc640 \ud328\ud0a4\uc9c0 \uad00\ub9ac\uac00 \ub3d9\uc791\ud558\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4.\\r\\n\\r\\n\ubcf8 \uae00\uc5d0\uc11c\ub294 **Ubuntu \ud658\uacbd\uc5d0\uc11c Node.js \uc124\uce58 -> React \ud504\ub85c\uc81d\ud2b8 \uc0dd\uc131 -> \ubb34\ub8cc \ub300\uc2dc\ubcf4\ub4dc \ud15c\ud50c\ub9bf \uc2e4\ud589**\uae4c\uc9c0 \ub0b4\uc6a9\uc744 \uc815\ub9ac\ud569\ub2c8\ub2e4.\\r\\n\\r\\n\\r\\n## 0. JavaScript, Node.js, React\uc758 \uad00\uacc4\\r\\n\uae00\uc744 \uc2dc\uc791\ud558\uae30 \uc804 JavaScript\uc640 Node.js, React \uad00\uacc4\uc5d0 \ub300\ud574 \uac04\ub2e8\ud558\uac8c \uc18c\uac1c\ud569\ub2c8\ub2e4.\\r\\nReact\ub294 \ube0c\ub77c\uc6b0\uc800\uc5d0\uc11c \uc2e4\ud589\ub418\uc9c0\ub9cc, \uac1c\ubc1c \uacfc\uc815\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \ube4c\ub4dc, \ud328\ud0a4\uc9c0 \uc124\uce58, \uc11c\ubc84 \uc2e4\ud589\uc740 \ubaa8\ub450 Node.js\uac00 \ub2f4\ub2f9\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n<br/> \ub530\ub77c\uc11c, React \uac1c\ubc1c\uc744 \uc704\ud574\uc11c\ub294 Node.js \uc124\uce58\uac00 \ud544\uc694\ud569\ub2c8\ub2e4.\\r\\n\\r\\n| \uad6c\ubd84         | \uc5ed\ud560                        |\\r\\n| ---------- | ------------------------- |\\r\\n| JavaScript | \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4                  |\\r\\n| Node.js    | JavaScript \uc2e4\ud589 \ud658\uacbd(\ub7f0\ud0c0\uc784)     |\\r\\n| React      | JavaScript\ub85c UI\ub97c \ub9cc\ub4dc\ub294 \ub77c\uc774\ube0c\ub7ec\ub9ac |\\r\\n\\r\\n## 1. Node.js \uc124\uce58\\r\\nNode.js\uc758 \ud544\uc694\uc131\uc5d0 \ub300\ud574 \uc54c\uc544\ubcf4\uc558\uc73c\ub2c8 \uc124\uce58\ub97c \uc9c4\ud589\ud574\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\r\\n<br/>\uc800\ub294 Linux\uc5d0\uc11c 24.13.0 \ubc84\uc804\uc744 \uc124\uce58\ud558\uc600\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n```\\r\\n1) nvm \ub2e4\uc6b4\ub85c\ub4dc \ubc0f \uc124\uce58\\r\\ncurl -o- https://raw.githubusercontent.com/nvm-sh/nvm/v0.40.1/install.sh | bash\\r\\n\\r\\n2) nvm \uc801\uc6a9\\r\\nsource ~/.bashrc\\r\\n\\r\\n3) nvm \uc124\uce58 \ud655\uc778\\r\\nnvm -v\\r\\n\\r\\n4) Node.js \ub2e4\uc6b4\ub85c\ub4dc \ubc0f \uc124\uce58\\r\\nnvm install 24\\r\\n\\r\\n5) \uc124\uce58 Node.js \ubc84\uc804 \ud655\uc778 \ubc0f npm \ubc84\uc804 \ud655\uc778\\r\\nnode -v\\r\\nnpm -v\\r\\n```\\r\\n\\r\\nKADaP Cloud \uc0ac\uc6a9\uc2dc, ssh\ub97c \ud1b5\ud574 VM \uc811\uc18d \ud6c4 \ub3d9\uc77c\ud55c \ubc29\ubc95\uc73c\ub85c \uc124\uce58\ud558\uc2dc\uba74 \ub429\ub2c8\ub2e4.    \\r\\n    <img src=\\"/img/usecase/minju/02_react/image-10.png\\" alt=\\"react\\"/>\\r\\n\\r\\n## 2. React \ud504\ub85c\uc81d\ud2b8 \uc0dd\uc131\\r\\n\\r\\n```\\r\\n1 or 2 \ub458 \uc911 \ud558\ub098 \uc120\ud0dd\\r\\n\\r\\n1) npm create-react-app my-react-app\\r\\n2) npm create vite@latest my-react-app\\r\\n```\\r\\n\\r\\n\\r\\n```\\r\\nnpm start\\r\\nhttp://localhost:3000 \uc811\uc18d (KADaP Cloud \uc0ac\uc6a9\uc790: http://<vm ip>:3000)\\r\\n\\r\\n```\\r\\n\\r\\n<img src=\\"/img/usecase/minju/02_react/image-15.png\\" alt=\\"react\\"/>\\r\\n\\r\\n\\r\\n## 3. \ubb34\ub8cc React Dashboard Templete \uc2e4\ud589\ud558\uae30\\r\\n\\r\\n\uc624\ud508\ub41c \ubb34\ub8cc Dashboard \ud15c\ud50c\ub9bf\uc744 \ud1b5\ud574 \ube60\ub974\uac8c \uac1c\ubc1c \ubc0f \ubc30\ud3ec \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n\uc544\ub798\ub294 \ub300\ud45c\uc801\uc778 \ubb34\ub8cc React dashboard templete \uc785\ub2c8\ub2e4.\\r\\n\\r\\n- Argon Dashboard React\\r\\n\\r\\n    <img src=\\"/img/usecase/minju/02_react/image-16.png\\" alt=\\"react\\"/>\\r\\n\\r\\n- Material Dashboard React\\r\\n\\r\\n    <img src=\\"/img/usecase/minju/02_react/image-17.png\\" alt=\\"react\\"/>\\r\\n\\r\\n- CoreUI React\\r\\n\\r\\n    <img src=\\"/img/usecase/minju/02_react/image-18.png\\" alt=\\"react\\"/>\\r\\n\\r\\n- AdminLTE Reac\\r\\n\\r\\n    <img src=\\"/img/usecase/minju/02_react/image-19.png\\" alt=\\"react\\"/>\\r\\n\\r\\n\ubcf8 \uae00\uc5d0\uc11c\ub294 Argon Dashboard\ub85c \uc2dc\uc791\ud574\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n### 3.1 \ud15c\ud50c\ub9bf \uac00\uc838\uc624\uae30(Git clone)\\r\\n\\r\\n```\\r\\ngit clone https://github.com/creativetimofficial/argon-dashboard-react.git\\r\\n```\\r\\n\\r\\n### 3.2 \ud3f4\ub354 \uc774\ub3d9\\r\\n\\r\\n```\\r\\ncd argon-dashboard-react\\r\\n```\\r\\n\\r\\n### 3.3 \ud328\ud0a4\uc9c0 \uc124\uce58\\r\\n\\r\\n```\\r\\nnpm install\\r\\n```\\r\\n\\r\\n### 3.4 \uc2e4\ud589\\r\\n\\r\\n```\\r\\nnpm start (\ub610\ub294) npm run dev\\r\\n```\\r\\n\\r\\n<img src=\\"/img/usecase/minju/02_react/image-20.png\\" alt=\\"react\\"/>\\r\\n\\r\\n\uc5f0\uacb0 \uc131\uacf5!"},{"id":"Customizing-Chatbot","metadata":{"permalink":"/usecase/Customizing-Chatbot","source":"@site/usecase/2026-01-19-Customizing-Chatbot.mdx","title":"Customizing-Chatbot","description":"Chainlit \uc744 \uc774\uc6a9\ud55c customizing chatbot \uad6c\ucd95\ud558\uae30","date":"2026-01-19T00:00:00.000Z","tags":[],"readingTime":3.015,"hasTruncateMarker":false,"authors":[{"name":"\uc774\uc885\uadfc","title":"\ub370\uc774\ud130\ud50c\ub7ab\ud3fc\uc5f0\uad6c\uc13c\ud130 \uc5f0\uad6c\uc6d0","url":"https://github.com/bigdata-car","imageURL":"https://avatars.githubusercontent.com/u/49437473?v=4","key":"jklee2"}],"frontMatter":{"slug":"Customizing-Chatbot","title":"Customizing-Chatbot","authors":["jklee2"],"date":"2026-01-19T00:00:00.000Z","tag":["Chatbot"],"image":"/img/usecase/chainlit.png","description":"Chainlit \uc744 \uc774\uc6a9\ud55c customizing chatbot \uad6c\ucd95\ud558\uae30"},"unlisted":false,"prevItem":{"title":"Node.js \uc124\uce58\ubd80\ud130 React \ud504\ub85c\uc81d\ud2b8 \uc2dc\uc791\uae4c\uc9c0","permalink":"/usecase/React"},"nextItem":{"title":"\uc6f9 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \ubc30\ud3ec\ub97c \uc704\ud55c Vercel \uc0ac\uc6a9\ud558\uae30","permalink":"/usecase/Vercel"}},"content":"|\ud56d\ubaa9|Chainlit|CopilotKit|Assistant-UI|Prompt-Kit|\\n|---|---|---|---|---|\\n|GitHub Starts|10,900|27,700|7,300|1,900|\\n|Frontend|React|React|React|React|\\n|\uc2a4\ud2b8\ub9ac\ubc0d|\ud83d\udfe2 \uc9c0\uc6d0|\u26a0\ufe0f \ucee4\uc2a4\ud140|\ud83d\udfe2 \uc9c0\uc6d0|\u274c \uc9c1\uc811 \uad6c\ud604|\\n|\ud30c\uc77c \uc5c5\ub85c\ub4dc|\ud83d\udfe2 \uc9c0\uc6d0|\u26a0\ufe0f \ucee4\uc2a4\ud140|\u26a0\ufe0f \ucee4\uc2a4\ud140|\u26a0\ufe0f \ucee4\uc2a4\ud140|\\n|\ub9c8\ud06c\ub2e4\uc6b4|\ud83d\udfe2 \uc9c0\uc6d0|\u26a0\ufe0f \ucee4\uc2a4\ud140|\ud83d\udfe2 \uc9c0\uc6d0|\u26a0\ufe0f \ucee4\uc2a4\ud140|\\n|\ucf54\ub4dc \ud558\uc774\ub77c\uc774\ud305|\ud83d\udfe2 \uc9c0\uc6d0|\u26a0\ufe0f \ucee4\uc2a4\ud140|\ud83d\udfe2 \uc9c0\uc6d0|\u26a0\ufe0f \ucee4\uc2a4\ud140|\\n|Chain of Thought|\ud83d\udfe2 \uc9c0\uc6d0|\u274c|\u274c|\u26a0\ufe0f \ucee4\uc2a4\ud140|\\n|\uba40\ud2f0\ubaa8\ub2ec|\u26a0\ufe0f \uc81c\ud55c\uc801|\ud83d\udfe2 \uc9c0\uc6d0|\ud83d\udfe2 \uc9c0\uc6d0|\u26a0\ufe0f \uc81c\ud55c\uc801|\\n|MCP \uc9c0\uc6d0|\ud83d\udfe2 \uc9c0\uc6d0|\u26a0\ufe0f \ucee4\uc2a4\ud140|\u26a0\ufe0f \ucee4\uc2a4\ud140|\u274c|\\n|\uc790\uccb4 \ud638\uc2a4\ud305|\ud83d\udfe2 \uc9c0\uc6d0|\ud83d\udfe2 \uc9c0\uc6d0|\ud83d\udfe2 \uc9c0\uc6d0|\ud83d\udfe2 \uc9c0\uc6d0|\\n|\uad6c\ud604 \ub09c\uc774\ub3c4|\ub0ae\uc74c|\uc911\uac04|\ub192\uc74c|\uc911\uac04|\\n\\n<br/>\\n\\n## **Chainlit**\\n\\n[Chainlit](https://github.com/Chainlit/chainlit?tab=readme-ov-file) \uc740 *python* \uae30\ubc18 \ub300\ud654\ud615 AI \uad6c\ucd95\ud558\uae30 \uc704\ud55c \uc624\ud508\uc18c\uc2a4 \ud328\ud0a4\uc9c0 \\n\\n### **1. Installation**\\n- Chainlit requires `python>=3.9`\\n<br/><br/>\\n\\n\\npip \ub97c \uc774\uc6a9\ud574\uc11c Chainlit\uc744 \uc124\uce58\ud569\ub2c8\ub2e4.\\n```bash\\npip install chainlit\\n```\\n\\n\uc124\uce58\ud558\uba74 bash \ud658\uacbd\uc5d0\uc11c chainlit \uba85\ub839\uc5b4\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\uac8c \ub429\ub2c8\ub2e4.\\n```bash\\nchainlit hello\\n```\\n\\n\uc774 \uba85\ub839\uc5b4\ub97c \uc2e4\ud589\ud558\uba74 Chainlit\uc774 \uae30\ubcf8 \ud15c\ud50c\ub9bf\uc744 \uc0ac\uc6a9\ud558\uc5ec \uac04\ub2e8\ud55c \ub300\ud654\ud615 AI \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uc0dd\uc131\ud569\ub2c8\ub2e4.\\n\\n<figure><img src=\\"/img/usecase/Chainlit-installation.png\\" alt=\\"Chainlit Installation\\" /><figcaption>Chainlit Installation</figcaption></figure>\\n\\n### **2. Python tutorial**\\nChainlit \uc740 python \uc73c\ub85c LLM \uc571\uc744 \uad6c\ucd95\ud560 \uc218 \uc788\ub3c4\ub85d \uc9c0\uc6d0\ud569\ub2c8\ub2e4.\\n\\n- `chainlit` \ud328\ud0a4\uc9c0 \uc784\ud3ec\ud2b8\ud558\uace0 \ucc57\ubd07 UI\uc5d0 \ub4e4\uc5b4\uc624\ub294 \uba54\uc2dc\uc9c0 \ucc98\ub9ac\ud558\ub294 \ud568\uc218\ub97c \uc815\uc758\ud569\ub2c8\ub2e4.\\n- `main` \ud568\uc218\ub294 \uc0ac\uc6a9\uc790\uac00 \ucc57\ubd07 UI\uc5d0 \uba54\uc2dc\uc9c0\ub97c \uc785\ub825\ud560 \ub54c\ub9c8\ub2e4 \ud638\ucd9c\ub418\uba70, \ud568\uc218 \ub0b4\ubd80\uc5d0 \ud14d\uc2a4\ud2b8 \ubd84\uc11d, API \ud638\ucd9c, \uacb0\uacfc \uacc4\uc0b0 \ub4f1 \ub85c\uc9c1 \uad6c\ud604\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n```python\\nimport chainlit as cl\\n\\n\\n@cl.on_message\\nasync def main(message: cl.Message):\\n    # Your custom logic goes here...\\n\\n    # Send a response back to the user\\n    await cl.Message(\\n        content=f\\"Received: {message.content}\\",\\n    ).send()\\n```\\n\\n- `chainlit run` \uba85\ub839\uc5b4\ub97c \uc0ac\uc6a9\ud558\uc5ec \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uc2e4\ud589\ud569\ub2c8\ub2e4.\\n```bash\\nchainlit run app.py -w\\n```\\n\\n<figure><img src=\\"/img/usecase/Chainlit-python.png\\" alt=\\"Chainlit Python\\" /><figcaption>Chainlit Python</figcaption></figure>\\n\\n### **3. OpenAI API \uc5f0\ub3d9**\\nOpenAI \ub610\ub294 \uc678\ubd80 LLM \ubaa8\ub378\uc744 API \ud615\ud0dc\ub85c \uc5f0\ub3d9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n- OpenAI API \ud0a4\ub97c \ud658\uacbd \ubcc0\uc218\ub85c \uc124\uc815\ud558\uace0, chainlit \uacfc \uc5f0\ub3d9\ud558\uc5ec OpenAI \uc758 LLM \ubaa8\ub378\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n- `.env` \ud30c\uc77c\uc5d0 OpenAI API \ud0a4\ub97c \uc124\uc815\ud569\ub2c8\ub2e4.\\n\\n[.env]\\n```bash\\nOPENAI_API_KEY=your-openai-api-key\\n```\\n\\n[app.py]\\n```python\\nfrom openai import AsyncOpenAI\\nimport chainlit as cl\\nclient = AsyncOpenAI()\\n\\n# Instrument the OpenAI client\\ncl.instrument_openai()\\n\\nsettings = {\\n    \\"model\\": \\"gpt-3.5-turbo\\",\\n    \\"temperature\\": 0,\\n    # ... more settings\\n}\\n\\n@cl.on_message\\nasync def on_message(message: cl.Message):\\n    response = await client.chat.completions.create(\\n        messages=[\\n            {\\n                \\"content\\": \\"You are a helpful bot, you always reply in Spanish\\",\\n                \\"role\\": \\"system\\"\\n            },\\n            {\\n                \\"content\\": message.content,\\n                \\"role\\": \\"user\\"\\n            }\\n        ],\\n        **settings\\n    )\\n    await cl.Message(content=response.choices[0].message.content).send()\\n```"},{"id":"Vercel","metadata":{"permalink":"/usecase/Vercel","source":"@site/usecase/2026-01-19-Vercel.mdx","title":"\uc6f9 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \ubc30\ud3ec\ub97c \uc704\ud55c Vercel \uc0ac\uc6a9\ud558\uae30","description":"\uc6f9 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \ubc30\ud3ec\ub97c \uc704\ud55c Vercel \uc0ac\uc6a9\ud558\uae30","date":"2026-01-19T00:00:00.000Z","tags":[],"readingTime":11.93,"hasTruncateMarker":false,"authors":[{"name":"\ubc29\ubbfc\uc8fc","title":"\ub370\uc774\ud130\ud50c\ub7ab\ud3fc\uc5f0\uad6c\uc13c\ud130 \uc5f0\uad6c\uc6d0","url":"https://github.com/bigdata-car","imageURL":"https://avatars.githubusercontent.com/u/153149491?s=400&u=ea254e4f1d3adf57eaaab5bba70f2caed1142d30&v=4","key":"mjbang"}],"frontMatter":{"slug":"Vercel","title":"\uc6f9 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \ubc30\ud3ec\ub97c \uc704\ud55c Vercel \uc0ac\uc6a9\ud558\uae30","authors":["mjbang"],"date":"2026-01-19T00:00:00.000Z","tag":["Front-End"],"image":"/img/usecase/minju/01_vercel/vercel.jpg","description":"\uc6f9 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \ubc30\ud3ec\ub97c \uc704\ud55c Vercel \uc0ac\uc6a9\ud558\uae30"},"unlisted":false,"prevItem":{"title":"Customizing-Chatbot","permalink":"/usecase/Customizing-Chatbot"}},"content":"<img src=\\"/img/usecase/minju/01_vercel/image-2.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n \uc6f9 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \ubc30\ud3ec\ub97c \uc704\ud574\uc11c\ub294 \uc11c\ubc84, \ub3c4\uba54\uc778, SSL \uc124\uc815, CI/CD \uad6c\uc131, \uce90\uc2dc \ucd5c\uc801\ud654 \ub4f1 \ub9ce\uc740 \uc791\uc5c5\uc774 \ud544\uc694\ud569\ub2c8\ub2e4.\\r\\n \\r\\n Vercel\uc740 \uc774\ub7f0 \uacfc\uc815\uc744 \uc790\ub3d9\ud654\ud558\uc5ec, \uac1c\ubc1c\uc790\uac00 \ucf54\ub4dc \uc791\uc131\uc5d0 \uc9d1\uc911\ud558\uc5ec \uc27d\uace0 \ube60\ub974\uac8c \ubc30\ud3ec\ud560 \uc218 \uc788\ub3c4\ub85d \ub3c4\uc640\uc90d\ub2c8\ub2e4.\\r\\n Vercel\uc740 Next.js\ub97c \ub9cc\ub4e0 \ud68c\uc0ac\uc5d0\uc11c \uc6b4\uc601\ud558\ub294 \ud074\ub77c\uc6b0\ub4dc \ud50c\ub7ab\ud3fc\uc73c\ub85c React \ubc0f Next.js \uae30\ubc18 \uc6f9 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uac00\uc7a5 \ud6a8\uc728\uc801\uc73c\ub85c \ubc30\ud3ec\ud560 \uc218 \uc788\ub3c4\ub85d \uc124\uacc4\ub418\uc5b4\uc788\uc2b5\ub2c8\ub2e4.\\r\\n \\r\\n# 2. Vercel\uc758 \uc8fc\uc694 \uae30\ub2a5\\r\\n## 2-1. \uc815\uc801 \ubc0f \ub3d9\uc801 \uc0ac\uc774\ud2b8 \ubc30\ud3ec\\r\\n- Vercel\uc740 Gatsby, Next.js, SvelteKit\uc640 \uac19\uc740 \uc6f9 \ud504\ub808\uc784\uc6cc\ud06c\ub85c \uac1c\ubc1c\ud55c \uc815\uc801 \uc6f9\ud398\uc774\uc9c0\ub97c \uc27d\uac8c \ud638\uc2a4\ud305 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n    \uc608\ub97c \ub4e4\uc5b4 \ube14\ub85c\uadf8\ub098 \ub79c\ub529 \ud398\uc774\uc9c0\ucc98\ub7fc \ub0b4\uc6a9\uc774 \uac70\uc758 \ubcc0\ud558\uc9c0 \uc54a\ub294 \uc0ac\uc774\ud2b8\ub294 \uc815\uc815 \uc0ac\uc774\ud2b8\ub85c, \ub85c\uadf8\uc778, \uac8c\uc2dc\ud310, API \ud638\ucd9c\uc774 \ud544\uc694\ud55c \uc11c\ube44\uc2a4\ub294 \ub3d9\uc801 \uc0ac\uc774\ud2b8\ub85c \uc6b4\uc601 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n    Vercel\uc740 \ub450 \ud0c0\uc785 \uc0ac\uc774\ud2b8\ub97c \ud558\ub098\uc758 \ud50c\ub7ab\ud3fc\uc5d0\uc11c \ubaa8\ub450 \ucc98\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n- Vercel\uc758 \ud070 \uac15\uc810\uc740 \ub3d9\uc801 \uc0ac\uc774\ud2b8 \ub610\ud55c \ubb34\uc911\ub2e8 \ubc30\ud3ec\uac00 \uac00\ub2a5\ud569\ub2c8\ub2e4. \\r\\n\\r\\n    \ubb34\uc911\ub2e8 \ubc30\ud3ec\ub780 \uc11c\ube44\uc2a4\uc758 \uc911\ub2e8 \uc5c6\uc774 \uc0c8 \ubc84\uc804\uc744 \ubc30\ud3ec\ud558\ub294 \uac83\uc73c\ub85c, \uc0ac\uc6a9\uc790\uac00 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud558\ub294 \ub3d9\uc548\uc5d0\ub3c4 \uc5c5\ub370\uc774\ud2b8\uac00 \uac00\ub2a5\ud569\ub2c8\ub2e4.\\r\\n\\r\\n    \x3c!-- ![alt text](image-5.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-5.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n## 2-2. \uc790\ub3d9 CI/CD \ud30c\uc774\ud504\ub77c\uc778\\r\\n- GitHub, GitLab, Bitbucker \ub4f1\uc758 Git \ub9ac\ud3ec\uc9c0\ud1a0\ub9ac\uc5d0 \uc5f0\ub3d9\ud558\uc5ec \ubc30\ud3ec \ud30c\uc774\ud504\ub77c\uc778\uc774 \uc790\ub3d9\ud654\ub418\uc5b4 \ucf54\ub4dc \ubcc0\uacbd \uc2dc \ub9c8\ub2e4 \uc0c8\ub85c\uc6b4 \ube4c\ub4dc\uc640 \ubc30\ud3ec\uac00 \uac00\ub2a5\ud569\ub2c8\ub2e4. \\r\\n\\r\\n    \x3c!-- ![alt text](image-6.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-6.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n    Vercel\uc740 Zero-Config \ubc30\ud3ec\ub85c \ubcc4\ub3c4\uc758 \uc124\uc815 \ud30c\uc77c\uc774\ub098 \ube4c\ub4dc \uc2a4\ud06c\ub9bd\ud2b8 \uc791\uc131 \uc5c6\uc774, \uc2dc\uc2a4\ud15c\uc774 \uc18c\uc2a4 \ucf54\ub4dc\ub97c \ubd84\uc11d\ud558\uc5ec \ud544\uc694\ud55c \ube4c\ub4dc \ubc0f \ucd5c\uc801\ud654\ub97c \uc218\ud589\ud569\ub2c8\ub2e4. \ub530\ub77c\uc11c, \uac1c\ubc1c\uc790\uc758 \uc218\ub3d9 \uac1c\uc785 \uc5c6\uc774 \uc77c\uad00\ub41c \ubc30\ud3ec\uac00 \uac00\ub2a5\ud569\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574 \ubc30\ud3ec \uc2e4\uc218, \ud658\uacbd \ucc28\uc774\ub85c \uc778\ud55c \uc624\ub958\ub97c \ud06c\uac8c \uc904\uc77c \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n- \ube0c\ub79c\uce58 \uae30\ubc18 \ubc30\ud3ec\ub97c \uc9c0\uc6d0\ud558\uae30 \ub54c\ubb38\uc5d0 \uc9c0\uc815\ub41c \ud504\ub85c\ub355\uc158 \ube0c\ub79c\uce58\uc5d0 merge \ub418\uba74 \uc790\ub3d9\uc73c\ub85c \ud504\ub85c\ub355\uc158 \uc0ac\uc774\ud2b8\uc5d0 \uc801\uc6a9\ub418\uace0, \uae30\ud0c0 \ube0c\ub79c\uce58\uc5d0 merge\ud560 \uacbd\uc6b0 \ud504\ub9ac\ubdf0 \ubc30\ud3ec\ub97c \uc0dd\uc131\ud569\ub2c8\ub2e4.\\r\\n- Vercel\uc740 roll-back \uae30\ub2a5\ub3c4 \uc81c\uacf5\ud558\uc5ec \uc7a5\uc560 \ubc1c\uc0dd\uc2dc \uc774\uc804 \ubc84\uc804\uc73c\ub85c \uc7ac\uc801\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n## 2-3. Edge Functions\\r\\n- Edge Functions\uc740 \uc0ac\uc6a9\uc790\uc640 \uac00\uc7a5 \uac00\uae4c\uc6b4 \uc704\uce58\uc5d0\uc11c \ucf54\ub4dc\uac00 \uc2e4\ud589\ud560 \uc218 \uc788\uac8c \ub9cc\ub4dc\ub294 \uc11c\ubc84\uce21 TypeScript \ud568\uc218\uc785\ub2c8\ub2e4. \\r\\n\\r\\n    \uc77c\ubc18\uc801\uc778 Serverless \ud568\uc218\uac00 AWS \ub9ac\uc804 \ub4f1 \uc911\uc559\uc5d0\uc11c \uc2e4\ud589\ub418\ub294 \ubc18\uba74, Edge Function\uc740 \uc804 \uc138\uacc4\uc5d0 \ubd84\ud3ec\ub41c Vercel \uc5e3\uc9c0 \ub124\ud2b8\uc6cc\ud06c \uc0c1\uc5d0\uc11c \ubc30\ud3ec\ud560 \uc218 \uc788\uc5b4 \uc9c0\uc5f0 \uc2dc\uac04\uc744 \uc904\uc774\uace0 \uc131\ub2a5\uc744 \ud5a5\uc0c1 \uc2dc\ud0ac \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n- \ub85c\uadf8\uc778 \ud1a0\ud070 \uac80\uc99d, \uad6d\uac00/\uc9c0\uc5ed\ubcc4 \ud398\uc774\uc9c0 \ubd84\uae30, \uac04\ub2e8\ud55c API\uc751\ub2f5 \uac19\uc740 \uc791\uc5c5\uc5d0 \uc0ac\uc6a9\ud55c\ub2e4.\\r\\n```\\r\\nServerless?\\r\\n\\r\\n\uac1c\ubc1c\uc790 \ub610\ub294 \uc6b4\uc601\uc790\uac00 \uc9c1\uc811 \uc11c\ubc84\ub97c \uad00\ub9ac\ud558\uc9c0 \uc54a\uc544\ub3c4 \ub418\ub294 \uacbd\uc6b0\ub97c \uc758\ubbf8\ud55c\ub2e4.\\r\\n```\\r\\n\\r\\n## 2-4. \uc774\ubbf8\uc9c0 \ucd5c\uc801\ud654(Image Optimization)\\r\\n- Vercel\uc740 \uc774\ubbf8\uc9c0 \ucd5c\uc801\ud654 \uae30\ub2a5\uc744 \ud50c\ub7ab\ud3fc\uc5d0 \ub0b4\uc7a5\ud558\uc5ec \uc81c\uacf5\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \\r\\n\\r\\n    `<`img`>` \ud0dc\uadf8 \ub300\uc2e0 `<`Image`>` \ucef4\ud3ec\ub10c\ud2b8\ub97c \uc0ac\uc6a9\ud558\uba74 \ubcc4\ub3c4\uc758 \uc124\uc815 \uc5c6\uc774 \uc790\ub3d9\uc73c\ub85c \uc774\ubbf8\uc9c0 \ucd5c\uc801\ud654 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\uc774\ubbf8\uc9c0\ub294 \uc694\uccad\uc5d0 \ub9de\uac8c \ub9ac\uc0ac\uc774\uc9d5/\uc555\ucd95\ub418\uba70, CDN \uc5e3\uc9c0\uc5d0 \uce90\uc2dc\ub418\uc5b4 \uc774\ud6c4 \uc694\uccad \uc2dc \ube60\ub974\uac8c \uc81c\uacf5\ub429\ub2c8\ub2e4.\\r\\n\\r\\n\\r\\n## 2-5. \ud504\ub9ac\ubdf0 \ubc30\ud3ec(Preview Deployments)\\r\\n- Git \ube0c\ub79c\uce58\ub098 Pull request\uc5d0 \ub300\ud574\uc11c \uc790\ub3d9\uc73c\ub85c \ud504\ub9ac\ubdf0\uc6a9 \ubc30\ud3ec URL\uc774 \uc0dd\uc131\ub418\uba70 \ubc18\uc601\ub41c \uc6f9\uc0ac\uc774\ud2b8\ub97c \ub204\uad6c\ub098 \uc811\uc18d\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \\r\\n    \ud574\ub2f9 \uae30\ub2a5\uc740 \ud504\ub85c\ub355\uc158 \ud658\uacbd\uacfc \ub3d9\uc77c\ud55c \uc870\uac74\uc5d0\uc11c \ud14c\uc2a4\ud2b8\ub97c \uc9c4\ud589\ud560 \uc218 \uc788\uc5b4 \ub85c\uceec\uc5d0\uc11c \uc791\uc5c5\uc2dc \ubc1c\uc0dd\ud558\ub294 \ubb38\uc81c\ub97c \uc870\uae30\uc5d0 \ubc1c\uacac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \\r\\n- Vercel\uc740 \ub85c\uceec, \ud504\ub9ac\ubdf0, \ud504\ub85c\ub355\uc158 \uc138 \uac00\uc9c0 \ud658\uacbd\uc744 \uc9c0\uc6d0\ud569\ub2c8\ub2e4.     \\r\\n    \uc774\ub97c \ud1b5\ud574 \uac1c\ubc1c \ub2e8\uacc4\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub358 \ubc31\uc5d4\ub4dc API \uc5d4\ub4dc\ud3ec\uc778\ud2b8\uc640 \ud504\ub85c\ub355\uc158\uc5d0\uc11c \uc5d4\ub4dc\ud3ec\uc778\ud2b8\ub97c \ubd84\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n- \ub514\uc790\uc774\ub108, \uae30\ud68d\uc790, QA \ub2f4\ub2f9\uc790\uc5d0\uac8c URL\ub9cc \uc804\ub2ec\ud558\uba74 \uc989\uc2dc \uacb0\uacfc\ubb3c\uc744 \ud655\uc778\uc2dc\ud0ac \uc218 \uc788\uc5b4 \ud611\uc5c5 \ud6a8\uc728\uc774 \ud06c\uac8c \ud5a5\uc0c1\ub429\ub2c8\ub2e4.\\r\\n    \\r\\n\\r\\n# 3. \uc6f9 \ud638\uc2a4\ud305/\ubc30\ud3ec \uc720\uc0ac \uc11c\ube44\uc2a4\\r\\n## 3-1. Netlify\\r\\n\x3c!-- ![alt text](image-7.png) --\x3e\\r\\n<img src=\\"/img/usecase/minju/01_vercel/image-7.png\\" alt=\\"vercel\\" />\\r\\n\\r\\nVercel\uacfc \ub9ce\uc740 \uacf5\ud1b5\uc810\uc744 \uac00\uc9c4 \ud50c\ub7ab\ud3fc\uc73c\ub85c Git \uc5f0\ub3d9 \uc790\ub3d9 \ubc30\ud3ec, Serverless Function, Edge Function, \ube0c\ub79c\uce58\ubcc4 \ud504\ub9ac\ubdf0 \ubc30\ud3ec \uae30\ub2a5\uc744 \uac00\uc9c0\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uae30\ubcf8\uc801\uc73c\ub85c Jamstack \uae30\ub2a5\uc744 \uc81c\uacf5\ud558\uba70, \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc790\uc5d0\uac8c \ucd08\uc810\uc744 \ub9de\ucd94\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n```\\r\\nJamstack \uc774\ub780?\\r\\nJavaScript, API, Markup \uc758 \uc57d\uc790\ub85c \ube60\ub974\uace0 \uc548\uc804\ud558\uba70 \ud655\uc7a5 \uac00\ub2a5\ud55c \uc6f9\uc0ac\uc774\ud2b8 \uad6c\ucd95\uc744 \uc704\ud55c \uc544\ud0a4\ud14d\ucc98 \ud328\ud134\uc785\ub2c8\ub2e4.\\r\\n```\\r\\n- Vercel\uc740 React/Next.js \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc5d0 \ucd5c\uc801\ud654\ub418\uc5b4 \uc788\uc5b4, \ube4c\ub4dc \uc2dc \uc131\ub2a5 \ucd5c\uc801\ud654\ub97c \uc790\ub3d9\uc73c\ub85c \uc801\uc6a9\ud558\uc5ec \uae00\ub85c\ubc8c Edge \ub124\ud2b8\uc6cc\ud06c\ub85c \ubc30\ud3ec \uac00\ub2a5\ud569\ub2c8\ub2e4.\\r\\n- Netlify\ub294 Jamstack \uc62c\uc778\uc6d0 \ud50c\ub7ab\ud3fc\uc73c\ub85c \uc815\uc801 \uc0ac\uc774\ud2b8 \ubc30\ud3ec, \uc0ac\uc6a9\uc790 \uc778\uc99d, \uc11c\ubc84\ub9ac\uc2a4 \ud568\uc218, \ud50c\ub7ec\uadf8\uc778 \uc0dd\ud0dc\uacc4 \ub4f1 \ud3ed\ub113\uc740 \ubd80\uac00 \uae30\ub2a5\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4.\\r\\n- Netify\ub294 \uad11\ubc94\uc704\ud55c \ubb34\ub8cc \ud50c\ub79c\uc744 \uc81c\uacf5\ud558\ub294 \ubc18\uba74 Vercel\uc740 \ud55c \uacc4\uc815\ub2f9 200\uac1c \ud504\ub85c\uc81d\ud2b8, \ud300\uba64\ubc84 1\uc778 \uc81c\ud55c\uc774 \uc788\uc2b5\ub2c8\ub2e4.(Netlify 500\uac1c \uc0ac\uc774\ud2b8 \ud638\uc2a4\ud305 \uac00\ub2a5, \ubb34\uc81c\ud55c \ud300\uba64\ubc84)\\r\\n\\r\\n## 3-2. AWS Amplify\\r\\n\x3c!-- ![alt text](image-8.png) --\x3e\\r\\n<img src=\\"/img/usecase/minju/01_vercel/image-8.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n\\r\\n\uc544\ub9c8\uc874 \uc6f9 \uc11c\ube44\uc2a4\uac00 2018\ub144\uc5d0 \ucd9c\uc2dc\ud55c \ud480\uc2a4\ud0dd \ud504\ub860\ud2b8\uc5d4\ub4dc \ud50c\ub7ab\ud3fc\uc73c\ub85c, AWS\uc758 \uc778\ud504\ub77c\uc640 \uc11c\ube44\uc2a4\ub97c \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc790\uac00 \uc27d\uac8c \ud65c\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \\r\\n\\r\\nAWS\uc5d0\uc11c \uac1c\ubc1c\ud55c \ud50c\ub7ab\ud3fc\uc778 \ub9cc\ud07c, AWS\uc758 \ub2e4\ub978 \uc11c\ube44\uc2a4\ub4e4\uacfc \uc27d\uac8c \uc5f0\ub3d9\ud560 \uc218 \uc788\uc5b4 Database, Cognito \uc778\uc99d, S3 \uc2a4\ud1a0\ub9ac\uc9c0, AL/ML\uc11c\ube44\uc2a4\uae4c\uc9c0 \uc571\uc5d0 \uc5f0\ub3d9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \\r\\n\ud558\uc9c0\ub9cc, Amplify\ub294 \ubcf5\uc7a1\ud55c \uc124\uc815\uacfc AWS \uc9c0\uc2dd\uc744 \uc694\uad6c\ud558\uae30 \ub54c\ubb38\uc5d0 AWS\ub97c \uc798 \ubaa8\ub974\ub294 \uac1c\ubc1c\uc790\uc5d0\uac8c\ub294 \ubd80\ub2f4\uc774 \ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n## 3-3. cloudflare page\\r\\n\x3c!-- ![alt text](image-9.png) --\x3e\\r\\n<img src=\\"/img/usecase/minju/01_vercel/image-9.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n\\r\\nCloudFlare\uc5d0\uc11c 2020\ub144\uc5d0 \ucd9c\uc2dc\ud55c \uc815\uc801 \uc0ac\uc774\ud2b8 \ud638\uc2a4\ud305 \ubc0f Functions \uc11c\ube44\uc2a4\uc785\ub2c8\ub2e4.\\r\\n\\r\\nCloudFlare\ub294 \uc138\uacc4 \ucd5c\ub300 CDN \ub124\ud2b8\uc6cc\ud06c \uc911 \ud558\ub098\ub85c, Cloudflare page\ub294 \uc555\ub3c4\uc801\uc778 \uae00\ub85c\ubc8c \ubd84\uc0b0 \uc778\ud504\ub77c\uc640 \ube44\uc6a9 \ud6a8\uc728\uc131\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4.\\r\\nCloudflare page\ub294 \ud504\ub9ac\uc694\uae08\uc81c\uc5d0\ub3c4 \ubb34\uc81c\ud55c \ub300\uc5ed\ud3ed\uc744 \uc81c\uacf5\ud558\uace0 \uc788\uc5b4, \uc6f9 \ud2b8\ub798\ud53d\uc774 \uae09\uc99d\ud558\ub354\ub77c\uace0 \ucd94\uac00 \ube44\uc6a9 \uc5c6\uc774 \uc11c\ube44\uc2a4\ub97c \uc9c0\uc18d\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n## 3-4. Vercel / Netlify / Amplify / Cloudflare page \ud2b9\uc9d5 \ubc0f \ube44\uad50\\r\\n| \uad6c\ubd84          | Vercel                  | Netlify                  | Cloudflare Pages          |\\r\\n| ----------- | ----------------------- | ------------------------ | ------------------------- |\\r\\n| \ud575\uc2ec \ud3ec\uc9c0\uc158      | \ud504\ub860\ud2b8\uc5d4\ub4dc \uc804\uc6a9 \uace0\uc131\ub2a5 \ubc30\ud3ec \ud50c\ub7ab\ud3fc     | Jamstack \uc62c\uc778\uc6d0 \ubc30\ud3ec \ud50c\ub7ab\ud3fc      | CDN \uae30\ubc18 \ucd08\uace0\uc18d \uc815\uc801 \uc0ac\uc774\ud2b8 \ud50c\ub7ab\ud3fc     |\\r\\n| \ucd5c\uc801\ud654 \ub300\uc0c1      | Next.js / React \uc911\uc2ec      | \ud504\ub808\uc784\uc6cc\ud06c \uc804\ubc18 \ubc94\uc6a9              | \uc815\uc801 \uc0ac\uc774\ud2b8 \uc911\uc2ec                 |\\r\\n| \uc815\uc801 \uc0ac\uc774\ud2b8(SSG) | \uc9c0\uc6d0                      | \uc9c0\uc6d0                       | \ucd5c\uac15\uc810                       |\\r\\n| SSR \uc9c0\uc6d0      | \ub9e4\uc6b0 \uac15\ub825 (Next.js \ub124\uc774\ud2f0\ube0c)    | \uac00\ub2a5\ud558\ub098 \uc124\uc815 \ud544\uc694               | \uc81c\ud55c\uc801                       |\\r\\n| Edge \uc2e4\ud589     | Edge Functions \uc81c\uacf5       | Edge Functions \uc81c\uacf5        | Workers \uae30\ubc18 Edge Functions |\\r\\n| \uc11c\ubc84\ub9ac\uc2a4        | Serverless Functions \uc81c\uacf5 | Functions \uc81c\uacf5             | Workers\ub85c \ub300\uccb4               |\\r\\n| \uc131\ub2a5 \uc9c0\ud5a5       | \ub3d9\uc801\xb7\uc815\uc801 \ubaa8\ub450 \uace0\uc131\ub2a5            | \uc815\uc801 \uc704\uc8fc \uc548\uc815\uc801                | \uc815\uc801 \uc131\ub2a5 \ucd5c\uc0c1                  |\\r\\n| CI/CD       | Git \uc5f0\ub3d9 \uc790\ub3d9\ud654, \ud504\ub9ac\ubdf0 \ucd5c\uac15      | Git \uc5f0\ub3d9 \uc790\ub3d9\ud654, \uc548\uc815\uc801          | Git \uc5f0\ub3d9 \uc790\ub3d9\ud654, \ub2e8\uc21c            |\\r\\n| \ud504\ub9ac\ubdf0 \ubc30\ud3ec      | \ub9e4\uc6b0 \uac15\ub825 (\ucf54\uba58\ud2b8 \ud3ec\ud568)          | \uae30\ubcf8 \uc81c\uacf5                    | \uae30\ubcf8 \uc81c\uacf5                     |\\r\\n| \ubd80\uac00 \uae30\ub2a5       | \ubc30\ud3ec\xb7\uc131\ub2a5 \uc9d1\uc911, \uc678\ubd80 \uc11c\ube44\uc2a4 \uc5f0\ub3d9     | Form, Auth, Add-ons \ub4f1 \ud48d\ubd80 | \ubcf4\uc548\xb7CDN\xb7\ub300\uc5ed\ud3ed \uac15\uc810             |\\r\\n| \ubb34\ub8cc \uc815\ucc45       | \ube44\uad50\uc801 \uc81c\ud55c\uc801                 | \uac00\uc7a5 \uad00\ub300                    | \ub300\uc5ed\ud3ed \ubb34\uc81c\ud55c                   |\\r\\n| \uc801\ud569\ud55c \uacbd\uc6b0      | Next.js \uae30\ubc18 \uc11c\ube44\uc2a4, \uc81c\ud488\ud615 \uc6f9\uc571  | \uc815\uc801 \uc0ac\uc774\ud2b8 + \uae30\ub2a5 \ube60\ub978 \uad6c\ucd95        | \ub300\uaddc\ubaa8 \ud2b8\ub798\ud53d \uc815\uc801 \uc0ac\uc774\ud2b8            |\\r\\n\\r\\n- Vercel: Next.js\uc5d0 \ucd5c\uc801\ud654\ub41c \ud504\ub860\ud2b8\uc5d4\ub4dc \ubc30\ud3ec \ud50c\ub7ab\ud3fc\\r\\n- Netlify: \ub2e4\uc591\ud55c \ubd80\uac00\uae30\ub2a5\uc744 \uc81c\uacf5\ud558\ub294 Jamstack \uc62c\uc778\uc6d0 \ud50c\ub7ab\ud3fc\\r\\n- Cloudflare Pages: \ub300\uc5ed\ud3ed \ubb34\uc81c\ud55c CDN \uae30\ubc18 \uc815\uc801 \ud638\uc2a4\ud305\\r\\n\\r\\n\\r\\n# 4. Vercel\uc744 \ud65c\uc6a9\ud55c \uc6f9\ud398\uc774\uc9c0 \ubc30\ud3ec\ud558\uae30\\r\\n## 4-1. Vercel Platform\uc744 \ud65c\uc6a9\ud55c Domain \uc0dd\uc131 \ubc0f \ubc30\ud3ec\\r\\n1. Vercel \uc811\uc18d \ubc0f Log In\\r\\n    \\r\\n    \x3c!-- ![alt text](image-15.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-15.png\\" alt=\\"vercel\\" />\\r\\n    \\r\\n2. \ud504\ub85c\uc81d\ud2b8 \uc0dd\uc131\\r\\n    \\r\\n    \x3c!-- ![alt text](image-16.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-16.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n\\r\\n    \x3c!-- ![alt text](image-19.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-19.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n\\r\\n    1. GitHub \uacc4\uc815 \uc120\ud0dd\\r\\n    2. \ubc30\ud3ec\ud560 Repository \uc120\ud0dd\\r\\n    \\r\\n        \ubc30\ud3ec\ud560 repository\uac00 \uc5c6\ub294 \uacbd\uc6b0, Permission \ubcc0\uacbd\\r\\n\\r\\n    3. \uc6d0\ud558\ub294 repository Import\\r\\n\\r\\n3. \ubc30\ud3ec\\r\\n\\r\\n    \x3c!-- ![alt text](image-23.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-23.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n\\r\\n    - \ub3c4\uba54\uc778 \uc0dd\uc131: [https://react-dashboard-z2dj.vercel.app](https://react-dashboard-z2dj.vercel.app)\\r\\n\\r\\n4. \uc811\uc18d\\r\\n\\r\\n    \x3c!-- ![alt text](image-24.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-24.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n### 4-2. CLI\ub97c \ud65c\uc6a9\ud55c Domain \uc0dd\uc131 \ubc0f \ubc30\ud3ec\\r\\n\\r\\n1. Installing Vercel CLI\\r\\n\\r\\n    ```\\r\\n    # pnpm \uc124\uce58\\r\\n    npm install -g pnpm \\r\\n\\r\\n    # pnpm \ud658\uacbd\ubcc0\uc218 \uc124\uc815\\r\\n    pnpm setup\\r\\n\\r\\n    # vercel \uc124\uce58 \\r\\n    pnpm i -g vercel\\r\\n    ```\\r\\n    \x3c!-- ![alt text](image-25.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-25.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n2. Update Vercel CLI\\r\\n\\r\\n    ```\\r\\n    # update vercel CLI\\r\\n    pnpm i -g vercel@latest\\r\\n\\r\\n    # \ubc84\uc804 \ud655\uc778\\r\\n    vercel --version\\r\\n    ```\\r\\n\\r\\n3. Deploying from source\\r\\n\\r\\n    ```\\r\\n    # Deploys the current Vercel project, when run from the Vercel Project root.\\r\\n\\r\\n    vercel\\r\\n\\r\\n    ```\\r\\n    \x3c!-- ![alt text](image-26.png)\\r\\n    ![alt text](image-27.png)\\r\\n    ![alt text](image-32.png) --\x3e\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-26.png\\" alt=\\"vercel\\" />\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-27.png\\" alt=\\"vercel\\" />\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-32.png\\" alt=\\"vercel\\" />\\r\\n\\r\\n\\r\\n4. \uc811\uc18d\\r\\n\\r\\n    \x3c!-- ![alt text](image-33.png) --\x3e\\r\\n    \uc0dd\uc131\ub41c \ub3c4\uba54\uc778 \uc8fc\uc18c: [https://argon-dashboard-react-omega.vercel.app/](https://argon-dashboard-react-omega.vercel.app/)\\r\\n    <img src=\\"/img/usecase/minju/01_vercel/image-33.png\\" alt=\\"vercel\\" />"}]}}')}}]);